import styled from 'styled-components'

export const Container = styled.div`
    width: 100%;
    display: flex;
    flex-direction: column;
    text-align: center;
    align-items: center;
    align-content: center;
    justify-content: center;
    
    #insertPassword{
        color: #893DCC;
        font-size: 18px;
        margin-top: 20px;
    }
    h1{
        color: #893DCC;
    }

`

export const Password = styled.div`
    width: 400px;

    collapsible{
        width: 400px;
    }

    input{
        width: 340px;
        height: 30px;
        border: 3px solid #893DCC;  
    }
    img{
        width: 50px;
        height: 50px;
    }
`
